import React, { Component } from 'react';
import classes from './NavigationItems.module.css';
import NavigationItem from './NavigationItem/NavigationItem';
import {useNavigate,useLocation} from 'react-router-dom';


class NavigationsItems extends Component{

  render () {
   const locationHome="/";
  return(
  <ul className={classes.NavigationItems}>

    <NavigationItem link={locationHome}  {...this.props.location.pathname==locationHome? active : null}  >Burger Builder</NavigationItem>

    <NavigationItem link="/orders">Orders</NavigationItem>
    {/* {!props.isAuthenticated && <NavigationItem link="/orders">Orders</NavigationItem>} */}
    {/* {!props.isAuthenticated ?
      <NavigationItem link="/auth">Authenticate</NavigationItem>
      : <NavigationItem link="/logout">Logout</NavigationItem>} */}
  </ul>
  )}
};

function WithNavigate(props) {
  let navigate = useNavigate();
  const location = useLocation();

  //return <Blog {...props} navigate={navigate} location={location} />
  return <BurgerBuilder {...props} navigate={navigate} location={location} />
}


export default WithNavigate(NavigationsItems);
